    true,nt"url": null,nt"notes": "<p>Few adult Medicaid enrollees in Ohio
    voluntarily replace their private coverage with<br />nMedicaid. In 2008, only 2.9
    percent of new Medicaid adults voluntarily substituted public for private coverage
    (4.6 percent in 2004). Of these 2.9 percent who voluntarily substituted from private
    to public coverage, 38 percent reported that they could not afford their employer
    sponsored plan. The multivariate results for all private to Medicaid transitions
    find few significant differences, other than income, in the probability of transition.</p>n",nt"license_title":
